let generarPdf = () => {
  nombreAgente = document.getElementById("nombreAgente").value; 
  apellidoAgente = document.getElementById("apellidoAgente").value; 
  console.log("Hello");
  const doc = new jsPDF();
  doc.setFontSize(14);
  doc.setFontType("bold");
  doc.text(`${nombreAgente} ${apellidoAgente}`, 10, 10);
  let imageData = `data:image/png;base64,`;
  doc.addImage(imageData, 140, 10, 60, 30);
  doc.save("cita.pdf");
}
